import Issues from './Issues'
import axios from 'axios'

export const deleteIssue = issueId => {
  let url =
    'https://issue-tracker-spring-boot.herokuapp.com/issue/' + this.issueId

  axios.delete(url)
  new Issues().getIssueList()
}
